import { AI_MODELS } from '@/types/ai-models'

/**
 * Utility functions for displaying AI model names in a user-friendly format
 */

const MODEL_DISPLAY_NAME_LOOKUP = new Map<string, string>()
const LEGACY_MODEL_DISPLAY_OVERRIDES: Array<{
  provider: string
  versions: string[]
  displayName: string
}> = [
  {
    provider: 'gemini',
    versions: ['1.5-pro', 'gemini-1.5-pro'],
    displayName: 'Gemini 1.5 Pro',
  },
  {
    provider: 'gemini',
    versions: ['1.5-flash', 'gemini-1.5-flash'],
    displayName: 'Gemini 1.5 Flash',
  },
  {
    provider: 'gemini',
    versions: ['2.0-flash', 'gemini-2.0-flash'],
    displayName: 'Gemini 2.0 Flash',
  },
]

// Initialize with AI_MODELS configuration
AI_MODELS.forEach(model => {
  if (!model.modelVersion) return
  const key = `${model.provider}:${model.modelVersion}`.toLowerCase()
  MODEL_DISPLAY_NAME_LOOKUP.set(key, model.version)
})

// WHY: Historical analysis results still reference legacy model versions that aren't in AI_MODELS.
// Add explicit overrides so the UI can render consistent display names for those records.
LEGACY_MODEL_DISPLAY_OVERRIDES.forEach(({ provider, versions, displayName }) => {
  versions.forEach(version => {
    const key = `${provider}:${version}`.toLowerCase()
    if (!MODEL_DISPLAY_NAME_LOOKUP.has(key)) {
      MODEL_DISPLAY_NAME_LOOKUP.set(key, displayName)
    }
  })
})

