const PROVIDER_DISPLAY_NAMES: Record<string, string> = {
  gemini: 'Gemini',
  openai: 'OpenAI',
  'openai-gpt': 'OpenAI',
  google: 'Google',
  'google-ai-overview': 'Google AI Overview',
  perplexity: 'Perplexity',
